import Aff from "./Affiche";
import axios from "axios"
import { useState,useEffect } from "react";
export default function App() {
    const [serie,setserie]=useState([])
    useEffect(()=>{
        axios.get(`http://www.omdbapi.com/?apikey=4a78675b&s=${serie}&type=series`)
        .then(res=>setserie(res.data.Search))
    },[serie])
    serie.map((se,i)=>{
        return <Aff se={se} key={i} />
    })
}
